import axios from "axios";
import { useState } from "react";

function ComponentList(props){ 
    const [customers,setCustomers] = useState();
    axios.get("localhost:8080/customers").then(data => {
        setCustomers(data)
    })
    return(
        <div>
            {customers}
        </div>
    )
}
